                    "description": "LinkNYC is the City’s program to provide free high-speed Wi-Fi, nationwide calling, a dedicated 911 button, charging ports for mobile devices, and access to social services. The City has recently begun to roll out a new and improved design of the original LinkNYC kiosk: Link5G. This new design will provide all of the amenities of LinkNYC kiosks, with the added benefit of 4G and 5G connectivity to enhance mobile telecommunications networks. This dataset lists proposed new locations for LinkNYC kiosks that are currently open for public comment.",
