                    "name": "Pre-Application Meetings",
                    "id": "855v-w7mc",
                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "Informational \"Pre-application\" meetings are requests by members of the public, including prospective applicants, to meet with Board Staff and a Commissioner (typically, the Chair) to discuss zoning measures and controls on a Premises or area, the availability of relief from such zoning regulations, and the process by which an application may be filed. The data provided to BSA, generally, includes: date of meeting, representative, prior BSA action, and Premises location (borough, block, lot, address).",
                    "attribution": "Board of Standards and Appeals (BSA)",
