                    "name": "Zoning Application Portal (ZAP) - BBL",
                    "id": "2iga-a6mk",
                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "The Department of City Planning (DCP) processes land use applications submitted by City or other public agencies and other (private) applicants. This data set provides information on land use applications, specifically the project tracking and description data related to approximately 30,000 projects since the late 1970s.\n\nZAP project data appears on NYC Planning - Zoning Application Portal Search. It includes data migrated from the prior applications tracking system (LUCATS) and covers all projects that have been \"Noticed\" (that they will appear before the City Planning Commission in 30 or more days for Certification as complete for the ULURP process to begin) or Filed (a CEQR or Land Use application has been formally submitted to the Department for review) through completion (approval, disapproval, withdrawal, or termination). For more information on the land use and environmental review application process see: <a href=\"https://www1.nyc.gov/site/planning/applicants/applicant-portal/application-process.page\">Application Process Overview</a>\n\nYou can explore this data in the <a href=\"https://zap.planning.nyc.gov/projects\">Zoning Application Portal</a>\n\nTo report data errors or for questions, email <a href=\"mailto:zap_feedback_dl@planning.nyc.gov\">zap_feedback_dl@planning.nyc.gov</a>.",
                    "attribution": "Department of City Planning (DCP)",
