                    "name": "Street Seats - 2014-2019",
                    "id": "d83i-6us7",
                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "Street Seats is a citywide program where partners apply to transform underused streets into vibrant, social public spaces between the months of March through December (the Season). Street Seats are installed in the roadbed along the curb line to create an attractive setting for eating, reading, working, meeting a friend or taking a rest.\r\n\r\nFor additional information on Street Seats, please visit the DOT website: https://www1.nyc.gov/html/dot/html/pedestrians/streetseats.shtml\r\nFor current data, please search for Street Seats (current year)\r\n\r\nThis data was collected to track information regarding each locations and the partners that manage each StreetSeat. The data is collected via Excel and tracked throughout the Season. Each record represents one Street Seat location. This data can be used to geolocate all of the Street Seats within 2018 Season. The data gets updated throughout the Season to include more details.",
