                    "description": "Companies listed as of the most recent export date have been issued Class 1 self-hauler registrations by the Business Integrity Commission. They are authorized to remove, collect or dispose of trade waste that is generated in the course of operation of such person's business. (Companies removing, collecting or disposing of construction and demolition debris must apply for Exemption from Licensing Requirements, otherwise known as Class 2 Construction and Demolition Registration).\r\n\r\nThis data is collected on the entities that apply with the commission to operate as class 1 self hauler registrants. \r\n\r\nEach record represents an entity that is approved to operate in the City of New York by the Commission. \r\n\r\nThe  Application Type field denotes the class of application 'CL1' noting the type of applicant which is Class 1 Self Hauler Registration\r\n\r\nThe BIC Number field is unique to every company that applies to the Commission.",
