                    "name": "Low Income Housing Tax Credits Awarded by HPD: Project-Level (4% Awards)",
                    "id": "p8i7-ix2s",
                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "The Department of Housing Preservation and Development (HPD) receives a sub-allocation of 9% Low Income Housing Tax Credits and allocated its credits through one competitive round each calendar year.  It is also charged with allocating 4% Low Income Housing Tax Credits to projects receiving tax exempt bonds through New York City Housing Development Corporation.\r\nEach entry represents an allocation to a low income housing development project with households at or below 60% of Area Median Income.\r\n\r\nFor the Low Income Housing Tax Credits Awarded by HPD: Building-Level (4% Awards) dataset, please follow <a href=\"https://data.cityofnewyork.us/Housing-Development/Low-Income-Housing-Tax-Credits-Awarded-by-HPD-Buil/h9ws-rfd9\">this link</a>",
