                            "Borough in which project is physically located",
                            "Floor or Suite in the building address of the Parent Entity applying for Tax Credits",
                            "State location of the Parent Entity applying for Tax Credits",
                            "Date the DOCE was signed",
                            "Total number of units in the project",
                            "New York City’s boroughs are five county-level administrative divisions, with each one also being a state county. (Manhattan - New York County; Bronx - Bronx County; Brooklyn - Kings County; Queens - Queens County; Staten Island - Richmond County). NYC’s boroughs have existed since the consolidation of the city in 1898.",
