                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "<p>This dataset provides benefit, program, and resource information for over 80 health and human services available to NYC residents in all eleven local law languages. The data is kept up-to-date, including the most recent applications, eligibility requirements, and application dates. Information in this dataset is used on ACCESS NYC, Generation NYC, and Growing Up NYC.</p>\n\nReach out to products@nycopportunity.nyc.gov if you have any questions about this dataset.</br>\n\n<p>\"This data makes it easier for NYC residents to discover and be aware of multiple benefits they may be eligible for. NYC Opportunity Product team works with 15+ government agencies to collect and update this data. Each record in the dataset represents a benefit or program. </p>\n\n<li>Blank fields are NULL values in this dataset.</li>\n\n<li>The data can be used to develop new websites or directory resources to help residents to discover benefits they need. </li></p>\n\nThe English-only version of the data is available at https://data.cityofnewyork.us/Social-Services/NYC-Benefits-Platform-Benefits-and-Programs-Datase/kvhd-5fmu.\"",
