                            "The entity responsible for the maintenance of the Waterfront Public Access Area (WPAA). It is typically: Private Property Owned, but may also be: NYC DPR or NYC EDC",
                            "A general, 1-2 sentence descriptive overview of the Waterfront Public Access Area (WPAA) highlighting key features",
                            "Total supplemental public access area in square feet. Supplemental public access area is a public access area required in order to fulfill the minimum percentage of Waterfront Public Access Area (WPAA)required on a waterfront zoning lot, once a shore public walkway and upland connection have been provided.",
                            "Total Waterfront Public Access Area (WPAA) in square feet. WPAA area is the portion of a waterfront zoning lot where publicly accessible open space is provided to and along the shoreline.",
                            "Public hours of operation for Waterfront Public Access Areas (WPAAs). It is often Dawn to Dusk, but some WPAAs have seasonal differences in the times they are open.",
                            "Flag to indicate whether the Waterfront Public Access Area (WPAA) contians a Fishing, active use amenity. 1=Yes, 0=No",
