                    "domain": "data.cityofnewyork.us",
                    "additional_access_points":
                        [
                            {
                                "urls":
                                {
                                    "Hyperlink": "https://orthos.dhses.ny.gov/?Extent=-9603624.133747088,4774299.7366908705,-7659066.134172721,5795498.434580554&Layers=07_meter_dem_index_usgs,1_meter_dem_index_fema,1_meter_dem_index_usgs,1_meter_dem_index_tidal_water,1_meter_dem_index_hydro_flattened,1_meter_dem_index_usda_utm18n,1_meter_dem_index_usda_utm17n,1_meter_dem_index_nys,2_meter_dem_index_ne_lidar,2_meter_dem_index_nys,2_meter_dem_index_fema,2_meter_dem_index_monroe_county,2_meter_dem_index_tompkins_county,2_meter_dem_index_erie_county&layerGroups=DEMIndexes,Orthoimagery&rightMenu=0"
                                },
                                "description": "This dataset was created using data from both topographic (near-infrared/NIR) LiDAR and bathymetric (green) LiDAR data. The classified point cloud was used to create additional derived datasets such as the hydroflattened DEM, hydroenforced (Fill/Unfill) DEMs, Highest Hit DSM, Land Cover, Tree Canopy Change, and Shoreline datasets. This dataset is available in LAS 1.4 format. ",
                                "title": "Topobathymetric Classified Point Cloud",
                                "described_by": "https://data.cityofnewyork.us/api/views/7sc8-jtbz/files/1903f780-70fb-49da-ac3c-3fe55d84feb1?download=true&filename=Data_Dictionary_Topobathymetric_PointCloud.xlsx"
                            },
                            {
                                "urls":
                                {
                                    "Hyperlink": "https://gis.ny.gov/elevation/NYC-topobathymetric-DEM.htm"
                                },
                                "description": "This dataset represents the earth's surface with all vegetation and anthropogenic features removed and water bodies flattened. It is created using topographic (near-infrared) and bathymetric (green) LiDAR data and uses ground and bathymetric bottom point returns to generate a seamless 1 foot resolution gridded elevation dataset. This dataset is best used for deriving elevation values throughout the city, creating contours, and other cartographic uses.  ",
                                "title": "Topobathymetric Hydroflattened Digital Elevation Model (DEM)",
                                "described_by": "https://data.cityofnewyork.us/api/views/7sc8-jtbz/files/08bf38f2-87f4-437d-aeb6-ebaa912851c7?download=true&filename=Data_Dictionary_Topobathymetric_Hydroflattened_DEM.xlsx"
                            },
                            {
                                "urls":
                                {
                                    "Hyperlink": "https://gis.ny.gov/elevation/NYC-topobathymetric-DEM.htm"
                                },
                                "description": "This dataset represents the earth's surface with all vegetation and anthropogenic features removed and water bodies have been flattened. It is created using topographic (near-infrared) and bathymetric (green) LiDAR data and uses ground and bathymetric bottom point returns to generate a seamless 1 foot resolution gridded elevation dataset.  Hydroenforcement breaklines were created in the DEM (seen as \"burned channels\" in the DEM) at all artificial obstructions to flow (i.e. culverts). This version of the hydroenforcement model has all sinks filled to ensure correct surface water flow. This dataset is best used for hydrologic modeling analyses, such as flow accumulation, and localized hydrologic modeling.   This model should not be used to derive true elevation values as it has been modified by hydroenforcement breaklines and fill.",
                                "title": "Topobathymetric Hydroenforced (Filled) Digital Elevation Model (DEM)",
                                "described_by": "https://data.cityofnewyork.us/api/views/7sc8-jtbz/files/ec5d8854-8207-4be3-86a4-62a0743ddcd1?download=true&filename=Data_Dictionary_Topobathymetric_Hydroenforced_Fill_DEM.xlsx"
                            },
                            {
                                "urls":
                                {
                                    "Hyperlink": "https://gis.ny.gov/elevation/NYC-topobathymetric-DEM.htm"
                                },
                                "description": "This dataset represents the earth's surface with all vegetation and anthropogenic features removed and water bodies have been flattened. It is created using topographic (near-infrared) and bathymetric (green) LiDAR data and uses ground and bathymetric bottom point returns to generate a seamless 1 foot resolution gridded elevation dataset.  Hydroenforcement breaklines were created in the DEM (seen as \"burned channels\" in the DEM) at all artificial obstructions to flow (i.e. culverts). This version of the hydroenforcement model does not have sinks filled in. This dataset is best used for hydrologic modeling analyses, such as flow accumulation, and localized hydrologic modeling. Since this model is unfilled, custom fill may be applied which may be more appropriate for more localized hydrologic modeling analyses.  This model should not be used to derive true elevation values as it has been modified by hydroenforcement breaklines.",
                                "title": "Topobathymetric Hydroenforced (Unfilled) Digital Elevation Model (DEM)",
                                "described_by": "https://data.cityofnewyork.us/api/views/7sc8-jtbz/files/e41b9c9d-a177-4286-a41d-eff260588f7a?download=true&filename=Data_Dictionary_Topobathymetric_Hydroenforced_Unfill_DEM.xlsx"
                            },
                            {
                                "urls":
                                {
                                    "Hyperlink": "https://gis.ny.gov/elevation/NYC-topobathymetric-DEM.htm"
                                },
                                "description": "A topobathymetric highest hit digital surface model (DSM) derived from the 2017 Light Detection and Ranging (LiDAR) data capture.  It is created using topographic (near-infrared) and bathymetric (green) LiDAR data and uses highest hit returns to generate a 1 foot resolution gridded dataset which includes the earth's surface with all vegetation and anthropogenic features included. ",
                                "title": "Topobathymetric Highest Hit Digital Surface Model (DSM)",
                                "described_by": "https://data.cityofnewyork.us/api/views/7sc8-jtbz/files/c27aeda0-4539-4dad-9b7e-d122a0c7d039?download=true&filename=Data_Dictionary_Topobathymetric_Highest_Hit_DSM.xlsx"
                            }
                        ],
