                    "columns_description":
                        [
                            "Sign, Parking, Regulation, SIMS, STATUS, Location, Street",
                            "The totality of signs associated with \"Current\" sign orders represents the current asset inventory. Repair (R-) orders are always historical.",
                            "Order type, represents both regulatory category and geometry.",
                            "Lists which of the five administrative divisions of New York City the work order is located in, written as a word. ",
                            "For block front and stretch geometries, where the street the signs are on; for an intersection geometry, the major intersecting street.",
                            "Used in cases where an additional field is needed to create a unique location, such as when two streets intersect twice, and/or where there is an additional roadbed.",
                            "For block front and stretch geometries, the street that intersects at the beginning of the block; for an intersection geometry, the minor intersecting street.",
                            "Used in cases where an additional field is needed to create a unique location, such as when two streets intersect twice, and/or where there is an additional roadbed.",
                            "For block front and stretch geometries, the street that intersects at the end of the block; not applicable (null) for an intersection geometry.",
                            "Used in cases where an additional field is needed to create a unique location, such as when two streets intersect twice, and/or where there is an additional roadbed.",
                            "For block front and stretch geometries, the side of street, as all block front and stretch orders are written for only one side of a street.",
                            "The date the order was closed.",
                            "A unique identifier for a sign design.  (Note, the sign code identifies the sign design, not an instance of a sign on the street that uses that design.)",
                            "Includes description of regulation and superseding/superseded sign design if any.",
                            "Dimensions of sign, height by width.",
                            "Date the system started blocking the use of a defunct sign design.",
                            "Applicable only to intersection geometry orders and null for all others, an acronym that indicates the placement of a sign within an intersection.",
                            "All block front signs have a distance, which is relative to the curb line; intersection signs will have a distance only if the sign is physically located outside the intersection.",
                            "\"The direction that an arrow on a sign points.  For a block front sign, this is relative to the \"\"side of street\"\" direction.  For an intersection sign, it is relative to the street that is assumed north.  Arrow direction is generally applicable only to block front signs, with one significant exception--\"\"One Way\"\" intersection signs always have an arrow direction.  Only block front signs with a single arrow will have an arrow direction, signs with no arrow or a double arrow will not.\"",
                            "\"The general rule is that all intersection signs have a facing direction, with the exception of \"\"One Way\"\" signs, which only have an \"\"arrow points\"\" direction.  There are a few other minor exceptions.  The direction that a sign faces is relative to the \"\"Street Assumed North/South\"\".  Block front signs should never have a facing direction, with a few very minor exceptions.\"",
                            "The surface material used for a sign; the current standard is TIII for an intersection sign and \"Painted\" (PNTD) for a block front sign.",
                            "An acronym that represents the type of structure support the signs.",
                            "Notes that provide regulatory information about a particular sign sequence, such as a Bus Stop ID, name or destination, or something unusual about the location or installation of the sign.",
                            "The longitude of the sign location",
                            "The latitude of the sign location"
                        ],
