                    "description": "In accordance with Title 40 Part 403.8(f) (2) (viii) of the Code of Federal Regulations and Title 15, Section 19-10 (g) of the Rules of the City of New York, the Department of Environmental Protection is required to publish a list of establishments in New York City that were in significant noncompliance with applicable pretreatment standards and other requirements during the previous 12 months. Significant noncompliance is defined in 40 CFR 403.8(f) (2) (viii). Below is an alphabetical listing of these establishments for the period from July 1, 2015 to June 30, 2016.\r\n\r\n*These establishments are on the list for late reporting only.\r\n†These establishments are Non-Significant Industrial Users.",
