                    "id": "jzhd-m6uv",
                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "This dataset features business inspections conducted by DCWP. DCWP enforces key consumer protection, licensing, weights and measures, and workplace laws. In addition to patrol (routine) inspections at brick-and-mortar businesses, DCWP inspects licensed vehicles such as horse-drawn cabs, pedicabs, sightseeing buses, and tow trucks to ensure they are in compliance with their respective asset class requirements. DCWP also conducts 'Business Education' inspections, which are educational, violation-free visits. These visits are designed to help business owners learn about and comply with the laws that DCWP enforces.\n\nFor the archived DCWP Inspections, please refer to https://data.cityofnewyork.us/d/wyj6-frpa",
