                    "id": "kz4v-8ai2",
                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "This dataset corresponds to a current availability of plant species in various containers being offered to clients of the Greenbelt Native Plant Center.  Each line of data represents one instance of a particular plant species in a specific container size within the dataset.  Data is generated using groware software application to export to an excel document.  Data is updated ad hoc, depending on production and distribution needs (sometimes multiple times daily, other times 1xweekly or bi-weekly, for example). Data has not been geocoded, anonymized, etc to the best of my knowledge. The dataset changes to include new species that are grown and were not prevously distributed by GNPC. The dataset also has entries removed over time, as species are no longer grown. All fields are required.\n\nData dictionary: https://docs.google.com/spreadsheets/d/1TtrIKLJUStYKbVe6mdtRfqpKy1tNtXKJsiU1qmXWgF8/edit#gid=1281948611",
