                    "name": "DCWP Language Line Interpretation Services",
                    "id": "wapz-jfhq",
                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "Department of Consumer and Worker Protection (DCWP) believes that limited English proficiency (LEP) should not be a hindrance to accessing the services and information the Agency provides. Without language access services consumers and workers and business with limited English proficiency could face substantial hurdles to knowing their consumer and worker rights; business owners could struggle to navigate the rules and regulations that govern commerce and the workplace in New York City, and potentially struggle to complete the license application process.\n\nDCWP provides telephonic translation services to anyone requesting such assistance.  Each month DCWP receives an invoice that records each time a translation request was made and general information in relation to each transaction, including the language requested and the DCWP division which made the request. This dataset is compiles these translation service invoices since January 2016, the earliest date this information is available.",
                    "attribution": "Department of Consumer and Worker Protection (DCWP))",
                    "attribution_link": null,
                    "contact_email": null,
