                    "description": "New York City Department of Education 2015 - 2016 Career Technical Education Report.\nLocal Law 174, enacted in 2016, requires the Department of Education of the New York City School District to submit to post publicly an annual report on Career and Technical Education (CTE) programs in New York City schools. Note that this report covers the 2015-16 academic year.\nThis report provides information about CTE programs and students in CTE programs and CTE-designated high schools, as defined in Local Law 174. The report also includes information regarding the number of applicants to CTE-designated schools, the graduation outcomes of CTE-designated high schools, the number and ratio of certified CTE instructors at schools offering CTE, and Professional Development (PD) offerings related to CTE",
