                    "name": "DSNY Waste Characterization 2023 - Main Sort Results",
                    "id": "bpea-2i5q",
                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "The NYC Department of Sanitation (DSNY) conducted the 2023 Waste Characterization Study in the Fall of 2022 and Spring of 2023. The 2023 Study determined the waste composition of several major sources from which DSNY collects: residential households, New York City Public Schools, the New York City Housing Authority (NYCHA), and on-street litter baskets. Waste from these generators was categorized into 96 main material categories, which are provided in this dataset by residential strata and time period. Results are presented in absolute terms as the quantity by weight of each material type, per stream. The quantity of each material is calculated by applying the percent composition to the total quantity of specified DSNY collections.",
                    "attribution": "Department of Sanitation (DSNY)",
                    "attribution_link": null,
                    "contact_email": null,
