                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "This dataset contains agency authorized on-street parking placards (AAOSP) and citywide agency parking permits (CAPP) applications and/ issuances. Agency authorized on-street parking permits are for agency business issued to government employees, teachers and private school facilities. Citywide agency parking permits are for agency businesses issued to agency heads and top deputies, Elected Officials, New York Fire Department (FDNY) and Department of Investigation (DOI) for official agency business, valid 24 hours/ 7 days a week. \n\n<b>Note:</b> Agency Authorized On Street Parking (AAOSP) no longer allows to park at loading zones below 60th Street in Manhattan as per Local Law 167 of 2021. The law does not restrict this manner of parking in Manhattan locations north of 60th street, nor in any other the other boroughs.",
