                    "description": "Clients (veterans or Veterans w/ family) that were successfully housed through the Veteran Peer Coordinator (VPC) program during Fiscal 2019.\r\n</br>\r\nThis table reports the clients (veterans or Veterans w/ family) that were successfully housed through the Veteran Peer Coordinator (VPC) program. These moves are managed and reported by the Housing & Support Services (HSS) line of action. This data collected by the coordinators at various shelters across the city with the assistance of other city agencies. Each record represents a client intake, which entails a particular homelessness assistance request. The captured in this report can provide insight on the successful moves DVS processes, including some demographic information on the veterans DVS interacts with.  The report is manually recorded, compiling information from various systems and databases.",
