                    "description": "This table is the primary table for information about work orders, and contains general information - including a description of the work, assigned title, request date and completion date -  about each work order. Each row represents a single work order. The primary key field is EVT_CODE. The EVT_OBJECT field can be joined to the Assets table on OBJ_CODE to know which asset the work order was for.\r\n\r\nFor the User Guide, please follow <a href=\"https://docs.google.com/document/d/1UwyGGncb6oFMiOfgz73G-iM8Yea9ubz4931hPeBO9YQ/edit?usp=sharing\">this link</a>\r\nFor the Data Dictionary, please follow <a href=\"https://docs.google.com/spreadsheets/d/1pDr-BUe4LS7DvATfbOnd8UrV6s77krJgzqdq_gVYWqc/edit?usp=sharing\">this link </a>",
