                    "columns_description":
                        [
                            "The total number of apartments at the development including the Section 8 Transition apartments at the LLC1 developments.",
                            "",
                            "This is the average gross monthly rent of the households in each development. The average tenant share of rent for the Section 8 households in the LLC1 developments is included.",
                            "",
                            "New York State Senate District Number.",
                            "The date when the development underwent a Rental Assistance (RAD) / Permanent Affordability Commitment Together (PACT) conversion.",
                            "",
                            "Cubic Space (height x length x width of residential buildings) in all the buildings at a development, expressed as cubic feet. ",
                            "Consolidated Tenant Data Systems number.",
                            "Asset Management Project (AMP) numbers.",
                            "Assigned to a development during the development (construction) period.",
                            "This is the number of acres at a development less the land set aside for a park or playground. For the majority of developments this figure is the same as \"acres\".",
                            "Development name.",
                            "The number of persons living in the Section 8 Transition units in the LLC1 developments.",
                            "",
                            "Congressional District Number.",
                            "5 items in this field: Gut Rehab, New Const, New Const (Eld), Rehab, and Rehab (Eld).",
                            "The total number of persons living at the developments, including the Section 8 Transition apartments in the LLC1 developments.",
                            "Number of households on fixed income (households with income from Social Security, Supplementary Security Income (SSI), Survivors Insurance, Veterans Benefits, or Pension (as well as other Public or Non Public Benefits), while not earning employment income or receiving Public Assistance.",
                            "The number used by numerous computer applications to identify NYCHA Developments.",
                            "A senior development where all residents are senior, aged 62 or older, is denoted as \"Exclusively\". A development where only some buildings are designated for senior residents is denoted as \"Partially\".",
                            "This is Square Feet at a Development less the land set aside for a park or playground. For the majority of developments this figure is the same acreage.",
                            "The number of individual entrances in each development.",
                            "The Programs designations are: Federal, MHOP, Mixed Finance, Mixed Finance/LLC1, Mixed Finance LLC2, Mixed Finance/Non-NYCHA Development.",
                            "The land area of the development including buildings and grounds is shown in acres (one acre equals 43,560 square feet). ",
                            "Date on which City and / or State Developments were transferred to the Federal Program. There are 11 items in this field. They are: 1968/08/29-Fed Tran; 1971/06/29-Fed Tran; 1972/06/29-Fed Tran; 1977/07/01-ATP 1 (abbreviation for Authority Transfer Program); 1978/02/01-ATP 2; 1978/07/01-ATP 3; 1979/08/01-ATP 4; 1980/07/01-ATP 5; 1980/10/01-ATP 7; and 1995/07/13-PTA (abbreviation for Physical Transfer of Assets).",
                            "A \"Yes\" indicates developments where residents pay for their electricity.",
                            "A number that each development utilize for Operating Costs.",
                            "The number of persons living in all public housing units. The residents living in the Section 8 Transition units in the LLC1 developments are not included in this population count.",
                            "The Initial Occupancy Completion Date: The date when the development was at least 95% occupied.",
                            "Bronx, Brooklyn, Manhattan, Queens, or Staten Island.",
                            "Number of households on fixed income divided by the total number of households.",
                            "The average number of rental rooms per apartment is the number of rental rooms divided by the number of current units. The Section 8 units in the LLC1 Developments are included.",
                            "Cost to develop the property divided by the number of rental rooms at the time of original construction.",
                            "The total ground floor area of the building footprints of a development.",
                            "The number of floors in each building.",
                            "The number of residential buildings on the grounds that are used for dwelling units.",
                            "This number includes land acquired and developed as part of the development for a park or playground to be operated and manintained by the NYC Department of Parks. At State and City Developments, the park or playground is owned by the City of New York. At federal Developments, parks and playgrounds are leased to the City.",
                            "The number of non-residential buildings at a development.",
                            "Two items in this field Conventional and Turnkey.",
                            "Rental room count per unit is equal to 2 1/2 plus the number of bedrooms. The number of rental rooms includes balconies and half-bath as half-rooms.",
                            "The sum of the land cost, construction cost and site improvement cost, including fees for architects and engineers at the time of original construction.",
                            "The number of units available for occupancy in the development as per the January 1, 2024 Dwelling Unit Inventory which is used to track the number of units on the rent roll.",
                            "Community District Number.",
                            "New York City Council District Number.",
                            "The total number of apartments transitioned to the Section 8 Program in the LLC1 developments.",
                            "This is the building coverage, divided by a development’s total area in square feet. This figure is presented as a percentage. ",
                            "The U.S. Department of Housing and Urban Development (HUD) identification number.",
                            "Measure of development density as represented by the number of persons per acre.",
                            "A \"Yes\" indicates developments managed by a private management company.",
                            "New York State Assembly District Number.",
                            "For NYCHA Developments that fit into a relatively neat rectangular block or two, these fields should be the four border streets (north, south, east, and west) of the Development. For Developments that are spread over some distance such as West Farms Road Rehab, the streets that best define the location of the development are provided. "
                        ],
