                    "columns_description":
                        [
                            "Point geometry type",
                            "The mapped BBL is the BBL used to map the record. For condominium lots, the mapped BBL is the billing BBL, which is the 75nn-series record shown on the tax map and in MapPLUTO. It is generally associated with the condominium management organization. For air rights lots, the mapped BBL is the donating BBL from the Air_Rights_Lot table in the Department of Finance's Digital Tax Map. If there is more than one donating BBL, the one whose lot number most closely matches that of the air rights lot is used. For all other lots, MAPBBL is the same as BBL.",
                            "For City-owned properties that are leased to another entity, this field indicates whether the agreement is short-term, long-term, or there are both short- and long-term agreements present.",
                            "A value of \"D\" indicates potential disposition by the City.",
                            "Longitude based on the Geosupport label point for the billing BBL. Coordinate system is NAD_1983.",
                            "NYC borough - 1 (Manhattan), 2 (Bronx), 3 (Brooklyn), 4 (Queens), 5 (Staten Island)",
                            "10-digit identifier for a tax lot, consisting of the borough code followed by the tax block followed by the tax lot. The borough code is one numeric digit. The tax block is one to five numeric digits, preceded with leading zeros when the block is less than five digits. The tax lot is one to four digits and is preceded with leading zeros when the lot is less than four digits. For condominiums, this is usually the unit BBL.",
                            "House number",
                            "The community district or joint interest area for the tax lot. The city is divided into 59 community districts and 12 joint interest areas, which are large parks or airports that are not considered part of any community district. This field consists of three digits, the first of which is the borough code. The second and third digits are the community district or joint interest area number, whichever is applicable.",
                            "X coordinate based on the Geosupport label point for the billing BBL. Coordinate system is NAD 1983 State Plane New York Long Island FIPS 3104 Feet.",
                            "This categorization classifies records into broad groups based on use. Valid values are 1 - 9.",
                            "Name of the parcel or facility on the lot. DCP applies some modifications to parcel names to improve readability. Some abbreviations are expanded programmatically. Other modifications are made after manual research. For the latter, DCPEDITED = \"Y\".",
                            "A value of \"L\" indicates that the agency's use of the property is authorized through a lease. For questions about the lease or ownership status of specific lots, please contact DCAS at (212) 386-0622 or RESPlanning311@dcas.nyc.gov.",
                            "Name of the street",
                            "This column was automatically created in order to record in what polygon from the dataset 'Community Districts' (f5dn-yrer) the point in column 'the_geom' is located.  This enables the creation of region maps (choropleths) in the visualization canvas and data lens.",
                            "The use code indicates how the lot is being used by the agency. See Appendix B for a complete list of use codes and descriptions.",
                            "Category classifies lots as non-residential properties with a current use, residential properties, or properties without a current use.",
                            "Descriptions for the expanded category values. See EXPANDCAT for the domain values.",
                            "Abbreviation for agency or entity using the lot. See appendix A for a list of abbreviations with their full name.",
                            "This column was automatically created in order to record in what polygon from the dataset 'Borough Boundaries' (yeji-bk3q) the point in column 'the_geom' is located.  This enables the creation of region maps (choropleths) in the visualization canvas and data lens.",
                            "House number and street name",
                            "Y coordinate based on the Geosupport label point for the billing BBL. Coordinate system is NAD 1983 State Plane New York Long Island FIPS 3104 Feet.",
                            "Description of how the lot is being used by the agency. See Appendix B for a complete list of use codes and descriptions.",
                            "Type of owner",
                            "The tax block in which the tax lot is located. Each tax block is unique within a borough.",
                            "The number of the tax lot. Each tax lot is unique within a tax block.",
                            "Latitude based on the Geosupport label point for the billing BBL. Coordinate system is NAD_1983.",
                            "This column was automatically created in order to record in what polygon from the dataset 'City Council Districts' (92fq-4b7q) the point in column 'the_geom' is located.  This enables the creation of region maps (choropleths) in the visualization canvas and data lens.",
                            "This column was automatically created in order to record in what polygon from the dataset 'Police Precincts' (sbqj-enih) the point in column 'the_geom' is located.  This enables the creation of region maps (choropleths) in the visualization canvas and data lens."
                        ],
