                    "parent_fxf": [],
                    "description": "Cash Assistance and SNAP case rejections ordered by NYS Welfare Management System (WMS) rejection reason code. When a Cash Assistance or SNAP application is rejected, NYS Welfare Management System (WMS) records the reason for the rejection using a reason code. This file includes the count of all Cash Assistance and SNAP case rejections during the specified quarter and year, with the different NYS WMS rejection reason codes in the rows. Each record is one case which may include one or many recipients.\n\n<b>NOTE: </b>Because asterisks represent values between 1 and 10, users should not sum values across columns or rows to determine the total number of cases within a quarter.  Accurate totals are represented in the rows and columns labeled “Total”.",
