                    "name": "NYC Building Energy and Water Data Disclosure for Local Law 84 (2022-Present)",
                    "id": "5zyy-y8am",
                    "resource_name": null,
                    "parent_fxf": [],
                    "description": "Local Law 84 of 2009 (LL84) requires annual energy and water benchmarking data to be submitted by owners of buildings with more than 50,000 square feet. This data is collected via the Environmental Protection Agency's (EPA) <a href=\"https://www.energystar.gov/buildings/tools-and-resources/portfolio-manager-0\">Portfolio Manager website</a>\r\n\r\nEach property is identified by it's EPA assigned property ID, and can contain one or more tax lots identified by one or more BBLs (Borough, Block, Lot) or one or more buildings identified by one or more building identification numbers (BIN)\r\n\r\nPlease visit <a href=\"https://www1.nyc.gov/site/buildings/codes/benchmarking.page\">DOB's Benchmarking and Energy Efficiency Rating page</a>\r\n for additional information.",
                    "attribution": "Department of Buildings (DOB)",
