                            "\"You can use the following Alerts to spot check your properties for the most common errors that cause metrics to show as \"\"N/A.\"\"  These alert metrics are at the property level: Gross Floor Area is 0 ft2 – Your property Gross Floor Area must be larger than 0 ft2. Property has no uses – Each property must have at least one Property Use (ex: Office, Retail, K-12 School). A property use is automatically created when you first create a property. You can also create one on the Details tab. Data Center Issue (with Estimates, IT Configuration, or IT Meter) - If you have a Data Center, then you need to either be using Data Center Energy Estimates or have an IT Meter. This alert will flag any properties without the required data/meters. See this FAQ for more details. These alert metrics are available for Energy, Water, and Waste: No meters are associated with this property – This means you haven't told Portfolio Manager which meters to use towards your metrics. You can associate meters from the Energy (Water/Waste) tab, click \"\"Change Meter Selections.” Meter has less than 12 full calendar months of data – 12 full months of calendar data is required for all metrics. A “full month” includes the first and last days of that month. If your bills run from mid-month to mid-month, you will need 13 bills to equal \"\"12 full calendar months.\"\" Meter has overlaps – An overlap is where the same date is covered by multiple bills. Meter has gaps - A gap is where a date(s) is NOT covered by one of your bills.\"",
                            "\"When entering bills, you can mark entries as an \"\"Estimation\"\" if you've entered any estimated meter entries (for energy, water, or waste).  In Reporting, under Data Accuracy, you can choose three general metrics for \"\"Estimated Values\"\" (one for energy, water, and waste), and an \"\"Estimated Data Flag\"\" for each specific meter type. Yes - A meter(s) includes estimated usage. No - There are no estimated meter entries.\"",
                            "\"The Gross Floor Area (GFA) is the total “property” square footage, and a “property” can be a: Single building Campus of buildings Part of a building (such as a single tenant space). Depending on which above type you have, your exact GFA is determined differently: “Single buildings” and “campuses of buildings” measure the GFA between the outside surface of the exterior walls of the building(s). This includes all areas inside the building(s) including supporting areas. GFA is not the same as rentable space, but rather includes all area inside the building(s). Include in GFA: lobbies, tenant areas, common areas, meeting rooms, break rooms, atriums (count the base level only), restrooms, elevator shafts, stairwells, mechanical equipment areas, basements, storage rooms. Do not include in GFA: exterior spaces, balconies, patios, exterior loading docks, driveways, covered walkways, outdoor play courts (tennis, basketball, etc.), parking (How to enter parking?), the interstitial plenum space between floors (which house pipes and ventilation), crawl spaces. Although you do not include these areas in your GFA, you do include their energy use. Our algorithms assume buildings have outdoor usage, too. The GFA refers specifically to interior space. But, the energy use evaluated should be all the energy required to operate your building, which includes the energy used both inside and out. You may exclude the GFA of certain Property Uses, if they meet these 4 criteria (see this FAQ for details): The Property Use is less than 10% of the building’s GFA The Property Use is not a property type eligible to receive an ENERGY STAR score The Property Use is sub-metered so that both the Property Use’s energy consumption and GFA can be excluded The Property Use’s energy use patterns are significantly different than those of the rest of the building (ex: A cell phone tower on a building) “Parts of a building,” such as tenant spaces, measure the GFA of the “usable square feet.” Usable square feet include the specific area the tenant occupies to do business. Learn more about how to benchmark a tenant space.\"",
                            "\"IT Energy is the amount of energy required by the server racks, storage silos, and other IT equipment in the Data Center. IT Energy is a measure of energy (i.e. kWh), it should not be reported as an instantaneous reading of electric demand.  IT Energy may be measured at any of 4 locations: Uninterruptible Power Supply (UPS) Output (required for a score, in most cases) Power Distribution Unit (PDU) Input PDU Output Server/Equipment Input\"",
                            "\"IT Energy is the amount of energy required by the server racks, storage silos, and other IT equipment in the Data Center. IT Energy is a measure of energy (i.e. kWh), it should not be reported as an instantaneous reading of electric demand.  IT Energy may be measured at any of 4 locations: Uninterruptible Power Supply (UPS) Output (required for a score, in most cases) Power Distribution Unit (PDU) Input PDU Output Server/Equipment Input\"",
                            "Data Center Power Usage Effectiveness (PUE) is a measure of Data Center infrastructure efficiency, representing the amount of energy that is needed per unit delivered to IT equipment. It is computed as the total annual source energy divided by the annual IT source energy. A typical PUE value is about 2.0, which indicates that for every kWh that is delivered to IT equipment, an additional kWh is required for cooling, power supply, and infrastructure. PUE is the basis of the ENERGY STAR performance scale for Data Centers. PUE is only available for Stand-alone Data Centers (where the only Property Type is Data Center).",
