                            "Number of staffed beds per 1,000 sq ft",
                            "\"The Weekly Operating Hours is different depending on your property type: Office, Financial Office, Warehouse and Distribution Center. Your Weekly Operating Hours are the total number of hours per week where the majority of workers are present. For example, if the majority of workers are in your building from 8:00 am - 6:00 pm M-F, then your Weekly operating hours should be 50 (10 hrs * 5 days per week). If you have two or more tenants with hours that differ by more than 10%, then you should enter two separate Property Uses so that you can track them separately. If you have two or more tenants with hours that differ by less than 10%, use the largest tenant’s hours (based on Gross Floor Area). If your hours vary seasonally (ex: 1/2 day Fridays in the summer), use the schedule that is followed most often. If you have 2 shifts of workers, add the hours for both shifts. Do NOT count these hours: When the property is occupied only by maintenance, security, the cleaning crew, or other support personnel. HVAC startup or shutdown time Properties that serve the Public (retail stores, medical office, bank branch, courthouse, library, health club, etc). Your Weekly Operating Hours should be the hours that you are open to the public. Worship Facility. Your Weekly Operating Hours should reflect hours when the facility is typically open for operation, which may include worship services, choir practice, administrative use, committee meetings, classes, or other activities.\"",
                            "The count of all individual private apartments/ condominiums (both occupied and unoccupied) located in an individual building that is 10 or more stories in height.",
                            "Percent That Can Be Heated is the total percentage of your property that can be heated by mechanical equipment.",
                            "\"The Total Number of Residential Living Units is a count of all individual residential living units or apartments, including both occupied and unoccupied units.  In addition, please note these specific property type considerations: Multifamily Housing – The Total Number of Residential Living Units should count all individual private apartments/condominiums. There are three additional Property Use Details, which break this total into three different categories, according to building height. If your property has only one building, or if all buildings are of the same height, then you should enter “zero” for the other two categories. Portfolio Manager requires that the sum of these three values equal your Total Number of Residential Living Units: Number of Residential Living Units in a Low-rise (1-4 stories) – This includes all units located in an individual building that is 1 to 4 stories in height. Number of Residential Living Units in a Mid-rise (5-9 stories) –This includes all units located in an individual building that is 5 to 9 stories in height. Number of Residential Living Units in a High-rise (10 or more stories) – This includes all units located in an individual building that is 10 or more stories in height. Senior Living Communities - For communities where residents have individual rooms that open onto central corridors, each room is considered a single unit, even if there are two or more beds per room. For communities with apartment-type living units each apartment is considered a single unit. Do not count individual rooms within apartments or townhouses.\"",
                            "Percent That Can Be Heated is the total percentage of your property that can be heated by mechanical equipment.",
                            "\"The Gross Floor Area (GFA) is the total “property” square footage, and a “property” can be a: Single building Campus of buildings Part of a building (such as a single tenant space). Depending on which above type you have, your exact GFA is determined differently: “Single buildings” and “campuses of buildings” measure the GFA between the outside surface of the exterior walls of the building(s). This includes all areas inside the building(s) including supporting areas. GFA is not the same as rentable space, but rather includes all area inside the building(s). Include in GFA: lobbies, tenant areas, common areas, meeting rooms, break rooms, atriums (count the base level only), restrooms, elevator shafts, stairwells, mechanical equipment areas, basements, storage rooms. Do not include in GFA: exterior spaces, balconies, patios, exterior loading docks, driveways, covered walkways, outdoor play courts (tennis, basketball, etc.), parking (How to enter parking?), the interstitial plenum space between floors (which house pipes and ventilation), crawl spaces. Although you do not include these areas in your GFA, you do include their energy use. Our algorithms assume buildings have outdoor usage, too. The GFA refers specifically to interior space. But, the energy use evaluated should be all the energy required to operate your building, which includes the energy used both inside and out. You may exclude the GFA of certain Property Uses, if they meet these 4 criteria (see this FAQ for details): The Property Use is less than 10% of the building’s GFA The Property Use is not a property type eligible to receive an ENERGY STAR score The Property Use is sub-metered so that both the Property Use’s energy consumption and GFA can be excluded The Property Use’s energy use patterns are significantly different than those of the rest of the building (ex: A cell phone tower on a building) “Parts of a building,” such as tenant spaces, measure the GFA of the “usable square feet.” Usable square feet include the specific area the tenant occupies to do business. Learn more about how to benchmark a tenant space.\"",
