                            "The highest demand value across all your electric meters and all meter entries covered in the 12-month performance period. It is equal to the highest month’s value measured by one of your meters. It is not a cumulative number. If you have multiple electric meters tracking demand, only one meter’s monthly value will be equal to the Annual Maximum Demand",
                            "The month and year within the 12-month period that had the highest demand.",
                            "The name of the meter that had the highest measured demand, and its Meter ID that was assigned by Portfolio Manager when the meter was created. This is only important if you have multiple electric meters tracking demand because you can only get one Annual Maximum Demand per property.",
                            "Green Power is a generic term for renewable energy sources and specific clean energy technologies that emit fewer GHG emissions relative to other sources of energy that supply the electric grid. You may use green power directly from an on-site renewable system, or you may purchase green power from your utility or independent green power supplier. In order for power to be considered green, you must own what are called the Renewable Energy Certificates (RECs), or the legal claims/rights to the environmental benefits of the green power. These rights can be sold separately from the actual electricity (kWh). Therefore, please note the following distinction between Onsite and Offsite Green Power: Onsite Green Power – Power generated from an onsite renewable system. The only types of onsite green power currently tracked in Portfolio Manager are solar and wind power. Energy use from these systems is green only if you retain the rights to the RECs associated with the power generated by your system. If you sell the RECs (for example, through REC arbitrage), then you do not have onsite green power. Offsite Green Power – Green power purchases from your utility and/or independent purchases of RECs. If through utility purchases you acquire both electricity (kWh) and RECs, then you have the right to the Green Power. If you purchase your electricity (kWh) from your utility but your RECs from another provider, then you may attribute these RECs to your utility power. Offsite Green power sources in Portfolio Manager include Solar, Wind, Geothermal, Biogas (Landfill gas), Biomass, and Small Hydropower.",
                            "Green Power is a generic term for renewable energy sources and specific clean energy technologies that emit fewer GHG emissions relative to other sources of energy that supply the electric grid. You may use green power directly from an on-site renewable system, or you may purchase green power from your utility or independent green power supplier. In order for power to be considered green, you must own what are called the Renewable Energy Certificates (RECs), or the legal claims/rights to the environmental benefits of the green power. These rights can be sold separately from the actual electricity (kWh). Therefore, please note the following distinction between Onsite and Offsite Green Power: Onsite Green Power – Power generated from an onsite renewable system. The only types of onsite green power currently tracked in Portfolio Manager are solar and wind power. Energy use from these systems is green only if you retain the rights to the RECs associated with the power generated by your system. If you sell the RECs (for example, through REC arbitrage), then you do not have onsite green power. Offsite Green Power – Green power purchases from your utility and/or independent purchases of RECs. If through utility purchases you acquire both electricity (kWh) and RECs, then you have the right to the Green Power. If you purchase your electricity (kWh) from your utility but your RECs from another provider, then you may attribute these RECs to your utility power. Offsite Green power sources in Portfolio Manager include Solar, Wind, Geothermal, Biogas (Landfill gas), Biomass, and Small Hydropower.",
