                            "The number you enter when you first create a property. It can be edited on the Details tab, under “Basic Information.” This value does not change over time, and it is not time weighted. If you edit it, it deletes the previous value without saving a record of what it had been.",
                            "Hotel - Gross Floor Area (ft²)",
                            "The sum of the GFA of all the Property Uses that you entered on the Details tab, including parking GFA. This value is time weighted.",
                            "The sum of the GFA of all the Property Uses that you entered on the Details tab, excluding parking GFA. This number should match your “Property GFA – Self-Reported.” If you have Property Uses that change square footage frequently (like office space going vacant), this is a good check to make sure all of your Property Uses add up to the right number. This value is time weighted.",
